import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Header from './layout/Header';
import ProductosLista from './layout/ProductosLista';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
	<React.Fragment>
		<Header />
		<ProductosLista />
	</React.Fragment>
);
